import './App.css';
import React,{useState,useEffect} from 'react';
import GrassGrid from './GrassGrid/GrassGrid';

function App() {

  function Movement() {
    window.addEventListener('keydown', (event) => {
        switch (event.key){
            case 'ArrowUp': console.log('Su'); break;
            case 'ArrowDown': console.log('Giù'); break;
            case 'ArrowLeft': console.log('Sinistra'); break;
            case 'ArrowRight': console.log('Destra'); break;
        }
    })
  }

  return (
    <div>
      <div className="App">
        <header className="App-header">
            <GrassGrid></GrassGrid>
        </header>
      </div>
    </div>
  );
}

export default App;
